      var data;

      $scope.timeperiod = {};

      DictionariesSvc.getTimeperiods({
        timePeriodTypeId: 1
      }).then(function (timeperiods) {
        $scope.timeperiods = timeperiods;
      });

      function initData() {
        var row;
        $scope.chart = [];
        $scope.chartForDashBoard = [];

        var cartObj = {};
        var allTypes = {};
        for (var i = 0; i < data.length; i++){
          row =  data[i];
          if(row.departmentId === undefined) { continue; }
          $scope.chart.push(row);
          if(!cartObj[row.departmentId]) { cartObj[row.departmentId] = {}; }
          if(!allTypes[row.educationFormTypeId]) { allTypes[row.educationFormTypeId] = 0; }
          if(!cartObj[row.departmentId][row.educationFormTypeId]) { cartObj[row.departmentId][row.educationFormTypeId] = 0; }
          cartObj[row.departmentId][row.educationFormTypeId]++;
        }

        for (var x in cartObj){
          if (cartObj.hasOwnProperty(x)) {
            var val =  cartObj[x];
            row = {State: x, freq:{}, total:0};
            for (var k in allTypes) {
              if (allTypes.hasOwnProperty(k)) {
                row.freq[k]=allTypes[k];
              }
            }
            for (k in val) {
              if (val.hasOwnProperty(k)) {
                row.freq[k]=val[k];
                row.total+=val[k];
              }
            }
            $scope.chartForDashBoard.push(row);
          }
        }
      }

